var callMethod = async function(nonce, contractMethod, to, privKey) {
		var txValues = { nonce: nonce, to: to, data: contractMethod.encodeABI(), gas: transGas };
		var tx = await web3.eth.accounts.signTransaction(txValues, privKey);
		return web3.eth.sendSignedTransaction(tx.rawTransaction);
}

var deployContract = async function(contract, name, owner, privKey){
		var txCount = await web3.eth.getTransactionCount(owner, "pending");
		var txValues = { nonce: web3.utils.toHex(txCount), data: contract.options.data, gas: deployGas };
		var tx = await web3.eth.accounts.signTransaction(txValues, privKey);

		var receipt = await web3.eth.sendSignedTransaction(tx.rawTransaction);
		console.log(name + ' contract mined! Address: ', receipt.contractAddress);
		var copy = contract.clone();
		copy.options.address = receipt.contractAddress;

		return copy;
}

