var linkContractsDemo = async function(regulatorD, banker1D, banker2D, bankD, transactionD, account1D, account2D, check1D, check2D, checkmanager1D, checkmanager2D) {
    console.log('Linking contracts Demo start');

		var regulatorUserNonce = await web3.eth.getTransactionCount(regulatoruser, "pending");
		var bank1EthNonce = await web3.eth.getTransactionCount(bank1Eth, "pending");
		var bank2EthNonce = await web3.eth.getTransactionCount(bank2Eth, "pending");

    regulatorAddress = regulatorD.options.address;
    bankstoreAddress = bankD.options.address;
    banker1Address = banker1D.options.address;
    banker2Address = banker2D.options.address;
    transactionstoreAddress = transactionD.options.address;
    accountstore1Address = account1D.options.address;
    checkstore1Address = check1D.options.address;
    checkmanager1Address = checkmanager1D.options.address;
    accountstore2Address = account2D.options.address;
    checkstore2Address = check2D.options.address;
    checkmanager2Address = checkmanager2D.options.address;

		banker1 = banker1D;
		banker2 = banker2D;
		regulator = regulatorD;
		accountstore1 = account1D;
		bankstore = bankD;
		checkstore1 = check1D;
		transactionstore = transactionD;
		checkmanager1 = checkmanager1D;
		accountstore2 = account2D;
		checkstore2 = check2D;
		checkmanager2 = checkmanager2D;

		await callMethod(regulatorUserNonce++, transactionD.methods.setBankStoreContract(bankstoreAddress), transactionstoreAddress, regulatoruserPrivKey);
		await callMethod(regulatorUserNonce++, regulatorD.methods.setBankContract(bankstoreAddress), regulatorAddress, regulatoruserPrivKey);
		await callMethod(regulatorUserNonce++, regulatorD.methods.setTransactionContract(transactionstoreAddress), regulatorAddress, regulatoruserPrivKey);
		await callMethod(regulatorUserNonce++, regulatorD.methods.setRegulatorName(regulatorname), regulatorAddress, regulatoruserPrivKey);

		await callMethod(bank1EthNonce++, banker1D.methods.setAccountContract(accountstore1Address), banker1Address, bank1EthPrivKey);
		await callMethod(bank1EthNonce++, banker1D.methods.setCheckContract(checkstore1Address), banker1Address, bank1EthPrivKey);
		await callMethod(bank1EthNonce++, banker1D.methods.setCheckManagerContract(checkmanager1Address), banker1Address, bank1EthPrivKey);

		await callMethod(bank1EthNonce++, check1D.methods.setAccountStore(accountstore1Address), checkstore1Address, bank1EthPrivKey);
		await callMethod(bank1EthNonce++, check1D.methods.setTransactionStore(transactionstoreAddress), checkstore1Address, bank1EthPrivKey);

		await callMethod(bank1EthNonce++, checkmanager1D.methods.setAccountStore(accountstore1Address), checkmanager1Address, bank1EthPrivKey);
		await callMethod(bank1EthNonce++, checkmanager1D.methods.setCheckStore(checkstore1Address), checkmanager1Address, bank1EthPrivKey);
		await callMethod(bank1EthNonce++, check1D.methods.setManagerContractAddress(checkmanager1Address), checkstore1Address, bank1EthPrivKey);

		await callMethod(bank2EthNonce++, banker2D.methods.setAccountContract(accountstore2Address), banker2Address, bank2EthPrivKey);
		await callMethod(bank2EthNonce++, banker2D.methods.setCheckContract(checkstore2Address), banker2Address, bank2EthPrivKey);
		await callMethod(bank2EthNonce++, banker2D.methods.setCheckManagerContract(checkmanager2Address), banker2Address, bank2EthPrivKey);

		await callMethod(bank2EthNonce++, check2D.methods.setTransactionStore(transactionstoreAddress), checkstore2Address, bank2EthPrivKey);
		await callMethod(bank2EthNonce++, check2D.methods.setAccountStore(accountstore2Address), checkstore2Address, bank2EthPrivKey);

		await callMethod(bank2EthNonce++, checkmanager2D.methods.setAccountStore(accountstore2Address), checkmanager2Address, bank2EthPrivKey);
		await callMethod(bank2EthNonce++, checkmanager2D.methods.setCheckStore(checkstore2Address), checkmanager2Address, bank2EthPrivKey);
		await callMethod(bank2EthNonce++, check2D.methods.setManagerContractAddress(checkmanager2Address), checkstore2Address, bank2EthPrivKey);

    infoDemo();
};

